import '../App.css';
import cheetah from '../images/cheetah.jpeg';
import animals from '../images/animals.jpeg';
import bears from '../images/bears.jpeg';
import bears2 from '../images/bears2.jpeg';
import bears3 from '../images/bears3.jpeg';
import bears4 from '../images/bears4.jpeg';
import buffalo from '../images/buffalo.jpeg';
import camels from '../images/camels.jpeg';
import cats from '../images/cats.jpeg';
import chips from '../images/chips.jpeg';
import cows from '../images/cows.jpeg';
import doggo from '../images/doggo.jpeg';
import elephant from '../images/elephant.jpeg';
import giraffe from '../images/giraffe.jpeg';
import gorillaz from '../images/gorillaz.jpeg';
import gorillaz2 from '../images/gorillaz2.jpeg';
import gorillaz3 from '../images/gorillaz3.jpeg';
import hippos from '../images/hippos.jpeg';
import horses from '../images/horses.jpeg';
import lemurs from '../images/lemurs.jpeg';
import lionness from '../images/lionness.jpeg';
import lions from '../images/lions.jpeg';
import lontra from '../images/lontra.jpeg';
import monkeys from '../images/monkeys.jpeg';
import owls from '../images/owls.jpeg';
import owls2 from '../images/owls.jpeg';
import pandas from '../images/pandas.jpeg';
import penguins from '../images/penguins.jpeg';
import polarBear from '../images/polarBear.jpeg';
import squirrels from '../images/squirrels.jpeg';
import swans from '../images/swans.jpeg';
import Tartoise from '../images/Tartoise.jpeg';
import wildDoggo from '../images/wildDoggo.jpeg';
import Bats from '../components/Bats';

const App = () => {
  return (
    <div className="container">
        <div class="header">
          <h1>The Mother</h1>
        </div>
        <div id="gallery">
          <img src={animals} />
          <Bats />
          <img src={bears} />
          <img src={bears2} />
          <img src={bears3} />
          <img src={bears4} />
          <img src={buffalo} />
          <img src={cheetah}/>
          <img src={camels} />
          <img src={cats} />
          <img src={chips} />
          <img src={cows} />
          <img src={doggo} />
          <img src={elephant} />
          <img src={giraffe} />
          <img src={gorillaz} />
          <img src={gorillaz2} />
          <img src={gorillaz3} />
          <img src={hippos} />
          <img src={horses} />
          <img src={lemurs} />
          <img src={lionness} />
          <img src={lions} />
          <img src={lontra} />
          <img src={monkeys} />
          <img src={owls} />
          <img src={owls2} />
          <img src={pandas} />
          <img src={penguins} />
          <img src={polarBear} />
          <img src={squirrels} />
          <img src={swans} />
          <img src={Tartoise} />
          <img src={wildDoggo} />
        </div>
    </div>
  )
}

export default App;
